import {makeStyles} from "@material-ui/core";
export default makeStyles((theme) => ({
    appBar: {
        borderRadius: 4,
        marginBotton: '5rem',
        display: 'flex',
        padding: '16px',
      },
      heading: {
        color: 'rgba(0,183,255, 1)',
      },
      image: {
        marginLeft: '15px',
      },
      [theme.breakpoints.down('sm')]: {
        mainContainer: {
        flexDirection: 'column-reverse', 
        }
      }
}));
